import React, { Component } from 'react';

class SayHello extends Component {
	constructor(props) {
		super(props);
		this.state = { ahm: 0 };
	}
	hello() {
		alert('hello');
	}
	render() {
		return (
			<div>
				<span>Hello React {this.state.ahm}</span>
				<br />
				<button onClick={this.hello}>Press Me</button>
			</div>
		);
	}
}

export default SayHello;
